import * as React from 'react';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Link from '@mui/material/Link';
import ProTip from './ProTip';

const styles = theme => ({
  root: {
      width: "100%",
      maxWidth: 360,
      background: theme.palette.background.paper
  },
  nested: {
      paddingLeft: theme.spacing.unit * 4
  }
});
function getItems() {
  var json = {
      list: [
          {
              id: 1,
              title: "Google",
              items: [
                  {
                      id: 1,
                      name: "Android",
                      subitems: [
                          {
                              id: 1,
                              name: "Nougat"
                          },
                          {
                              id: 2,
                              name: "Lollipop"
                          }
                      ]
                  },
                  {
                      id: 2,
                      name: "Chrome"
                  }
              ]
          },
          {
              id: 2,
              title: "Apple",
              items: [
                  {
                      id: 1,
                      name: "Mac"
                  },
                  {
                      id: 2,
                      name: "Iphone",
                      subitems: [
                          {
                              id: 1,
                              name: "Iphone 6"
                          },
                          {
                              id: 2,
                              name: "Iphone 10"
                          }
                      ]
                  }
              ]
          },
          {
              id: 3,
              title: "Uber",
              items: [
                  {
                      id: 1,
                      name: "Eats"
                  },
                  {
                      id: 2,
                      name: "Freight"
                  }
              ]
          }
      ]
  };
  return json;
}
class NestedList extends React.Component {
  state = {};
  handleClick = e => {
      this.setState({ [e]: !this.state[e] });
  };
  render() {
      const items = getItems();
      const { classes } = this.props;
      return (
          <div>
              {items.list.map(list => {
                  return (
                      <List
                          className={classes.root}
                          key={list.id}
                          subheader={
                              <ListSubheader>{list.title}</ListSubheader>
                          }
                      >
                          {list.items.map(item => {
                              return (
                                  <div key={item.id}>
                                      {item.subitems != null ? (
                                          <div key={item.id}>
                                              <ListItem
                                                  button
                                                  key={item.id}
                                                  onClick={this.handleClick.bind(
                                                      this,
                                                      item.name
                                                  )}
                                              >
                                                  <ListItemText
                                                      primary={item.name}
                                                  />
                                                  {this.state[item.name] ? (
                                                      <ExpandLess />
                                                  ) : (
                                                      <ExpandMore />
                                                  )}
                                              </ListItem>
                                              <Collapse
                                                  key={list.items.id}
                                                  component="li"
                                                  in={this.state[item.name]}
                                                  timeout="auto"
                                                  unmountOnExit
                                              >
                                                  <List disablePadding>
                                                      {item.subitems.map(
                                                          sitem => {
                                                              return (
                                                                  <ListItem
                                                                      button
                                                                      key={
                                                                          sitem.id
                                                                      }
                                                                      className={
                                                                          classes.nested
                                                                      }
                                                                  >
                                                                      <ListItemText
                                                                          key={
                                                                              sitem.id
                                                                          }
                                                                          primary={
                                                                              sitem.name
                                                                          }
                                                                      />
                                                                  </ListItem>
                                                              );
                                                          }
                                                      )}
                                                  </List>
                                              </Collapse>{" "}
                                          </div>
                                      ) : (
                                          <ListItem
                                              button
                                              onClick={this.handleClick.bind(
                                                  this,
                                                  item.name
                                              )}
                                              key={item.id}
                                          >
                                              <ListItemText
                                                  primary={item.name}
                                              />
                                          </ListItem>
                                      )}
                                  </div>
                              );
                          })}
                          <Divider key={list.id} absolute />
                      </List>
                  );
              })}
          </div>
      );
  }
}
NestedList.propTypes = {
  classes: PropTypes.object.isRequired
};
export default withStyles(styles)(NestedList);
